import { Status } from "../models/Status";

interface StatusDetailsProps {
    status: Status;
}

const StatusDetails = (props: StatusDetailsProps): JSX.Element => {
    const { status } = props;

    return (
        <>
            <h2>{status.username}</h2>
            <p>{status.text}</p>
        </>
    )
}

export default StatusDetails;
